import Footer from "../Footer";
import Header from "../Header";
import { Title, Text } from "./styles";

export default function History() {
    return (
        <>
            <Header />
            <Title>Histórico</Title>
            <Text>Em breve você poderá ver o histórico dos seus hábitos aqui!</Text>
            <Footer />
        </>
    );
}
